import { Table } from 'react-bootstrap'
import { useSelector } from 'react-redux'

function Cart(){
    let a = useSelector((state)=>{return state})
    console.log(a,'a');
    return (
        <div>
            <Table>
            <thead>
                <tr>
                <th>#</th>
                <th>상품명</th>
                <th>수량</th>
                <th>변경하기</th>
                </tr>
            </thead>
            {
            a.cart.map(function(item, i){
              return(
                <tbody>
                <tr>
                <td>{i}</td>
                <td>{item.name}</td>
                <td>{item.count}</td>
                <td></td>
                </tr>
                </tbody>
              )
            })
          }
            </Table> 
        </div>
    )
}
export default Cart
